description:
Color Zen is a new kind of puzzle game for phones and tablets. One that invites you to put on your headphones, relax, and find your way through an abstract world of colors and shapes. There is no score. 

No penalties for failure. Just a simple set of rules, intuitive controls, and satisfying puzzles. Get into the flow with Color Zen.

